import logo from './logo.svg';
import './App.css';
import { Route, Routes } from 'react-router-dom';
import LoginPage from './screens/LoginPage';

function App() {
  return 
    <div className='container'>
      <Routes>
        <Route path='LoginPage' element={<LoginPage/>}></Route>
      </Routes>

    </div>
}

export default App;
